### Step 1: Set Up the Project Structure

First, create a new project folder and set up the basic structure:

```bash
mkdir myapp
cd myapp
```

Create two separate folders for the frontend (React) and backend (Node.js):

```bash
mkdir backend frontend
```

### Step 2: Set Up the Backend (Node.js and Express.js)

1. Navigate to the backend folder:

```bash
cd backend
```

2. Initialize a new Node.js project:

```bash
npm init -y
```

3. Install the required dependencies:

```bash
npm install express cors mongoose axios
```

